{
    "Comment": "mdp-adhoc",
    "StartAt": "START mdp-adhoc extracts",
    "States": {
        "START mdp-adhoc extracts": {
            "Type": "Pass",
            "InputPath": "$",
            "OutputPath": "$",
            "Next": "CHECK 212778050_parametric_data"
        },
        "CHECK 212778050_parametric_data": {
            "Type": "Choice",
            "Choices": [
                {
                    "Variable": "$.INPUT.212778050_parametric_data",
                    "StringEquals": "Y",
                    "Next": "SKIP 212778050_parametric_data"
                }
            ],
            "Default": "EXTRACT 212778050_parametric_data"
        },
        "EXTRACT 212778050_parametric_data": {
            "Type": "Task",
            "Resource": "arn:aws:states:::glue:startJobRun.sync",
            "Parameters": {
                "JobName": "us-prod-daasbatchextract",
                "Arguments": {
                    "--application_name": "mdp-adhoc",
                    "--extract_number": "1"
                }
            },
            "ResultPath": null,
            "End": true
        },
        "SKIP 212778050_parametric_data": {
            "Type": "Pass",
            "End": true
        }
    }
}
